    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 * - col2 BETWEEN + 69 * col0 * + col1 AND + col2 * + 84;
  - name: tab1

outputs:
  - name: q9406.out
    data: |
      51	14	96
      85	5	59
      91	47	68
